import { useState } from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Button/>
      </header>
    </div>
  );
}
function Button(){
  const [counter, setCounter] = useState(0);
  return <button onClick={logRandom}>{counter}</button>
}

function logRandom(){
  console.log(Math.random());
}

export default App;
